export const ChevronLeft = ({ color = 'black', size = 18 }) => <Icon color={color} size={size}></Icon>

export function Chevron({ color = 'black', size = 18, rotate = 0 }) {
  return (
    <Text style={{ fontFamily: 'Icons', size: size, color: color, transform: `rotate(${rotate}deg)` }}></Text>
  )
}

export function Times({ color, size }) {
  return (
    <Icon color={color} size={size}>
      
    </Icon>
  )
}

